import React from 'react'
import { useCategoriesContext } from "../../hooks/usePostListContext";
import ListGroup from 'react-bootstrap/ListGroup';
import styles from '../../styles/Dashboard.module.css';
import { FaTrashAlt } from "react-icons/fa";




const Dashboard: React.FC = () => {

  interface Post {
    title: string;
  }

  const posts: Post[] = useCategoriesContext();

  return (
    <ListGroup as="ul" className={styles.postListContainer} horizontal>
      {posts.map((post: any, index: number) => (
        <ListGroup.Item key={index} as="li" variant="light" className={styles.postWrapper}>
          {post.title}
          <div className={styles.deleteIcon}>
          <FaTrashAlt />
          </div>
        </ListGroup.Item >
      ))}
    </ListGroup>

  )
}

export default Dashboard
